import React from 'react';

const FloatingRectangle = () => {
  return (
    <div className="floating-rectangle">
      <section className="about-me">
        <h2>About Me</h2>
        <p>Some text describing your background, skills, and projects.</p>
      </section>
      <section className="skills">
        <h3>Skills</h3>
        <ul>
          <li>3D Modeling</li>
          <li>Animation</li>
          <li>Technical Support</li>
        </ul>
      </section>
      <section className="experience">
        <h3>Experience</h3>
        <p>Details about your professional experience.</p>
      </section>
    </div>
  );
};

export default FloatingRectangle;
